import React from "react";
import "./App.css";

import NavigationBar from "./components/NavigationBar/NavigationBar";

function App() {
  return (
    <div>
      <NavigationBar />
      <iframe
        src="https://giphy.com/embed/oimbMCKmRTsl10Bg3v"
        width="480"
        height="270"
        frameBorder="0"
        className="giphy-embed"
        allowFullScreen
      ></iframe>
      <p>
        <a href="https://giphy.com/gifs/oimbMCKmRTsl10Bg3v">via GIPHY</a>
      </p>
    </div>
  );
}

export default App;
